import React from "react";

const Search = (querySent, query, onSearch) => {
  return (
    <div className="topnav">
      {!querySent && <h1>Query sent</h1>}
      <input
        type="text"
        placeholder="Search.."
        onSubmit={(e) => onSearch(query)}
      />
    </div>
  );
};

export default Search;
